// ASCII Art Animation System
class ASCIIArtAnimator {
  constructor(container, artVersions) {
    this.container = container;
    this.artVersions = artVersions;
    this.currentArtIndex = 0;
    this.isAnimating = false;
    this.animationSpeed = 8; // Speed multiplier for animation
    this.delayBetweenTransitions = 2500; // 2.5 seconds between transitions
    
    this.init();
  }
  
  init() {
    this.render();
    this.startAnimationLoop();
  }
  
  render() {
    // Simply display the current art version
    const currentArt = this.artVersions[this.currentArtIndex];
    this.container.innerHTML = `<pre class="ascii-art">${currentArt}</pre>`;
  }
  
  getRandomCenter() {
    // Get dimensions from current art
    const lines = this.artVersions[0].split('\n');
    const height = lines.length;
    const width = Math.max(...lines.map(line => line.length));
    
    // Choose interesting center points (not completely random)
    const centers = [
      { x: width * 0.3, y: height * 0.4 }, // Left eye area
      { x: width * 0.7, y: height * 0.4 }, // Right eye area  
      { x: width * 0.5, y: height * 0.6 }, // Nose area
      { x: width * 0.5, y: height * 0.8 }, // Bottom area
      { x: width * 0.2, y: height * 0.2 }, // Top left
      { x: width * 0.8, y: height * 0.2 }  // Top right
    ];
    
    return centers[Math.floor(Math.random() * centers.length)];
  }
  
  calculateDistance(x1, y1, x2, y2) {
    return Math.sqrt((x2 - x1) ** 2 + (y2 - y1) ** 2);
  }
  
  animateToNext() {
    if (this.isAnimating) return Promise.resolve();
    this.isAnimating = true;
    
    return new Promise((resolve) => {
      // Get next art version
      const nextIndex = (this.currentArtIndex + 1) % this.artVersions.length;
      const currentArt = this.artVersions[this.currentArtIndex];
      const nextArt = this.artVersions[nextIndex];
      
      // Split both arts into lines
      const currentLines = currentArt.split('\n');
      const nextLines = nextArt.split('\n');
      const maxLines = Math.max(currentLines.length, nextLines.length);
      const maxWidth = Math.max(
        ...currentLines.map(line => line.length),
        ...nextLines.map(line => line.length)
      );
      
      // Get animation center
      const center = this.getRandomCenter();
      
      // Create character positions with distances
      const characters = [];
      for (let y = 0; y < maxLines; y++) {
        for (let x = 0; x < maxWidth; x++) {
          const currentChar = currentLines[y] ? (currentLines[y][x] || ' ') : ' ';
          const nextChar = nextLines[y] ? (nextLines[y][x] || ' ') : ' ';
          
          if (currentChar !== nextChar) {
            const distance = this.calculateDistance(x, y, center.x, center.y);
            characters.push({ x, y, currentChar, nextChar, distance, changed: false });
          }
        }
      }
      
      // Sort by distance for wave effect
      characters.sort((a, b) => a.distance - b.distance);
      
      if (characters.length === 0) {
        // No changes needed
        this.currentArtIndex = nextIndex;
        this.isAnimating = false;
        resolve();
        return;
      }
      
      // Create initial display with current art
      let displayLines = currentLines.slice();
      
      // Ensure all lines exist and have proper length
      for (let i = 0; i < maxLines; i++) {
        if (!displayLines[i]) displayLines[i] = '';
        while (displayLines[i].length < maxWidth) {
          displayLines[i] += ' ';
        }
      }
      
      const maxDistance = Math.max(...characters.map(char => char.distance));
      const animationDuration = 1000; // 1 second total animation
      let startTime = null;
      
      const animate = (timestamp) => {
        if (!startTime) startTime = timestamp;
        const elapsed = timestamp - startTime;
        const progress = Math.min(elapsed / animationDuration, 1);
        
        // Calculate current wave position
        const wavePosition = progress * maxDistance;
        
        let hasChanges = false;
        characters.forEach(char => {
          if (!char.changed && char.distance <= wavePosition) {
            // Convert string to array for easier manipulation
            let lineArray = displayLines[char.y].split('');
            lineArray[char.x] = char.nextChar;
            displayLines[char.y] = lineArray.join('');
            char.changed = true;
            hasChanges = true;
          }
        });
        
        if (hasChanges) {
          // Update display
          const newArt = displayLines.join('\n');
          this.container.innerHTML = `<pre class="ascii-art">${newArt}</pre>`;
        }
        
        if (progress < 1) {
          requestAnimationFrame(animate);
        } else {
          // Animation complete
          this.currentArtIndex = nextIndex;
          this.render(); // Ensure we show the exact target art
          this.isAnimating = false;
          resolve();
        }
      };
      
      requestAnimationFrame(animate);
    });
  }
  
  startAnimationLoop() {
    console.log('ASCII Animation started - cycling between', this.artVersions.length, 'frames');
    
    const loop = () => {
      this.animateToNext().then(() => {
        console.log('Animation transition completed, current frame:', this.currentArtIndex);
        setTimeout(loop, this.delayBetweenTransitions);
      });
    };
    
    // Start first transition after initial delay
    setTimeout(() => {
      console.log('Starting first animation transition...');
      loop();
    }, this.delayBetweenTransitions);
  }
}

